import { Container, Navbar, Nav } from "react-bootstrap";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import HomeContent from "./HomeContent.jsx";
import Film from "./Film.jsx";
import Ranking from "./Ranking.jsx";
import Search from "./Search.jsx";
import Login from "./Login.jsx";
import { UserContext } from "./UserContext"
import React, { useState, useMemo } from "react";



const NavigationBar = () => {
    const[user, setUser] = useState("witam");
    const value = useMemo(() => ({ user, setUser }), [user, setUser]);


    return (
        <Router>
            <Navbar className="navbar-custom">
                    <Navbar.Brand as={Link} to="/">FILMBASE</Navbar.Brand>
                        <Container fluid className="justify-content-end">
                            <Nav.Link as={Link} to="/">Home</Nav.Link>
                            <Nav.Link as={Link} to="/ranking">Ranking</Nav.Link>
                            <Nav.Link as={Link} to="/search">Search</Nav.Link>
                            <Nav.Link as={Link} to="/login">{user}</Nav.Link>
                    </Container>
            </Navbar>
            
            <Routes>
                    <Route exact path="/" element={<UserContext.Provider value={ value }> <HomeContent/> </UserContext.Provider>}/>
                    <Route exact path="/ranking" element={<UserContext.Provider value={ value }><Ranking/>  </UserContext.Provider>} />
                    <Route exact path="/search" element={<UserContext.Provider value={ value }><Search/>  </UserContext.Provider>} />
                    <Route path="/film/:id" element={<UserContext.Provider value={ value }><Film />  </UserContext.Provider>} />
                    <Route path="/login" element={<UserContext.Provider value={ value }> <Login />  </UserContext.Provider>} />
            </Routes>
        </Router>
    );
}

export default NavigationBar
